    "2016-08-03T03:15:57.501107",nt"name": "summer-mean-enhanced-vegetation-index-for-the-diamond-valley-flow-system-groundwater-disch-2010",nt"isopen":
    false,nt"url": null,nt"notes": "These data were created as part of a hydrologic
    study to characterize groundwater budgets and water quality in the Diamond Valley
    Flow System (DVFS), central Nevada. This dataset represents the mean Enhanced Vegetation
    Index (EVI) of two Landsat 5 Thematic Mapper scenes from the summer of 2010 in the
    DVFS. The data were used to evaluate and estimate groundwater discharge by evapotranspiration
    by relating the mean of EVI calculated from July 24 and August 25, 2010 Landsat
    scenes to evapotranspiration measured at 4 eddy-covariance sites located in phreatophytic
    vegetation of varying types and densities in Kobeh Valley, Nevada. Evapotranspiration
    was extrapolated for all valleys in the study area using the relation developed
    for Kobeh valley.",nt"license_title": null,nt"extras": [{ntt"key":
